import { SET_MENU_OPEN } from '../actions/types';

const initialState = {
  opened: false,
};

export default (state = initialState, action) => {
  switch (action.type) {
    case SET_MENU_OPEN:
      return { ...state, opened: action.payload };
    default:
      return state;
  }
};
